package com.inventario.api;

import static org.hamcrest.Matchers.is;

import java.math.BigDecimal;

import org.joda.time.LocalDate;
import org.joda.time.format.DateTimeFormat;
import org.springframework.boot.test.context.SpringBootTest;

import com.inventario.InventarioApp;
import com.inventario.api.model.Equipment;

import cucumber.api.java8.En;
import io.restassured.RestAssured;
import io.restassured.response.Response;

@SpringBootTest(classes = InventarioApp.class, webEnvironment = SpringBootTest.WebEnvironment.RANDOM_PORT)
public class EquipmentApiStepdefs implements En {
	
	private Response resp;
	private Equipment eqpResponse;
	
	public EquipmentApiStepdefs() {
		this.implementSteps();
	}
	
	private void implementSteps() {
		Given("^user has access to the /equipment API$", () -> {});

		When("^user calls GET equipment$", () -> {
		    resp = RestAssured.when().get("/equipments");
		});

		Then("^user receives status code of (\\d+) and the list of equipments$", (Integer arg1) -> {
			resp.then().statusCode(200);
		});

		When("^user calls POST equipments with \"([^\"]*)\", (\\d+), , , $", (String arg1, Integer arg2) -> {
			
			resp = RestAssured.given().body(this.createEquipment()).when().post("/equipments");
		   eqpResponse = resp.body().as(Equipment.class);
		   
		});

		Then("^user receives status code of (\\d+) after register equipment$", (Integer arg1) -> {
			Equipment eqp = this.createEquipment();
			resp.then().statusCode(201)
			.body("modelEquipment", is(eqp.getModelEquipment()));
		});

		When("^user calls DELETE equipment (\\d+)$", (Integer codeEquipment) -> {
		   resp = RestAssured.when().delete("/equipments/"+ codeEquipment);
		});

		Then("^user receives status code of (\\d+) after delete equipment$", (Integer arg1) -> {
		  resp.then().statusCode(200);
		});

		When("^user calls GET equipment (\\d+)$", (Integer codeEquipment) -> {
			 resp = RestAssured.when().get("/equipments/"+codeEquipment);
		});

		Then("^user receives status code of (\\d+) and one equipment$", (Integer arg1) -> {
		    resp.then().statusCode(200);
		});
	}
	
	private Equipment createEquipment() {
		Equipment equipment = new Equipment();
	    LocalDate localdate = LocalDate.parse("2019-04-21", DateTimeFormat.forPattern("yyyy-MM-dd"));
	    
	    equipment.setDtEquipment(localdate);
	    equipment.setModelEquipment("Modelo Teste");
	    equipment.setTypeEquipment(1L);
	    equipment.setImageEquipment("data:image/png;base64,\r\n");
	    equipment.setValEquipment(new BigDecimal(24.1));
	    
	    return equipment;
	}

}
